function isSolidTile(tile)
	if tile >=  startSolidTile and  tile <= endSolidTile then
		return true
	end
	return false
end

function isDoorTile(tile)
	if tile == 32  or  tile == 33 or tile == 48 then
		return true
	end
	return false
end

function isMirrorTile(tile)
	if tile == 51  or  tile == 52 or tile == 67 or tile == 68  then
		return true
	end
	return false
end

function isDeathTile(tile)
	if tile == 19 or tile ==12 then
		return true
	end
	return false
end

function isLeverTile(tile)
	if tile == 208 then
	 return true
	end
	return false
end

function isDiamondTile(tile)
	if tile == 310 then
	 return true
	end
	return false
end

function isGrounded(xz, yz)
	local x1 = (xz + 1)//8 + Level.LevelNumber*30
	local x2 = (xz - 1)//8 + 2 + Level.LevelNumber*30
	local y1 = (yz + 1)//8 + Level.reflected*17
	local y2 = (yz)//8 + 2 + Level.reflected*17
	if isSolidTile(mget(x1, y2))  or isSolidTile(mget(x2, y2))  or isSolidTile(mget(x2 - 1, y2)) then
		return true
	end
	return false
end	

function isRoofed(xz, yz)
	local x1 = (xz+1)//8 + Level.LevelNumber*30
	local x2 = (xz - 1)//8 + 2 + Level.LevelNumber*30
	local y1 = (yz-1)//8 + Level.reflected*17
	if isSolidTile(mget(x1, y1)) or isSolidTile(mget(x2 - 1, y1)) or isSolidTile(mget(x2, y1)) then
		return true
	end
	return false
end
		
function leftBlocked(xz, yz)
	local x1 = (xz)//8 + Level.LevelNumber*30
	local y1 = (yz)//8 + Level.reflected*17
	local y2 = (yz -1)//8 + 2 + Level.reflected*17
	if isSolidTile(mget(x1, y1)) or isSolidTile(mget(x1, y2 - 1)) or isSolidTile(mget(x1, y2)) then
		return true
	end
	return false
end	

function rightBlocked(xz, yz)
	local x1 = (xz+1)//8 + Level.LevelNumber*30
	local x2 = xz//8 + 2 + Level.LevelNumber*30
	local y1 = (yz)//8 + Level.reflected*17
	local y2 = (yz - 1)//8 + 2 + Level.reflected*17
	if isSolidTile(mget(x2, y1)) or isSolidTile(mget(x2, y2 - 1)) or isSolidTile(mget(x2, y2)) then
		return true
	end
	return false
end

function mathY()
	local yCalc = 0
	local notGround = 0 
	if(isGrounded(Player.x, Player.y)) then notGround = 0 else notGround = 1 end
	--Caso se queira limitar a velocidade: Alterar vyMax e tirar comentarios das proximas 3 linhas

	--if(Player.voy+(notGround*Player.ay*t/60) < Player.vyMax) then Player.vy=(Player.voy+(notGround*Player.ay*t/60)) else Player.vy = Player.vyMax end
	--Comentar a linha seguinte caso se queira limitar a velocidade
	Player.vy=(Player.voy+(notGround*Player.ay*t/60))
	yCalc = Player.y + Player.vy*t/60

	--Correção de problemas com ficar enterrado e preso no teto
	if(isRoofed(Player.x, Player.y) and yCalc < ((Player.y - 1)//8) * 8) then Player.y = ((Player.y - 1)//8) * 8 else Player.y = yCalc end
	if(isGrounded(Player.x, Player.y) and yCalc > ((Player.y + 1)//8) * 8) then Player.y = ((Player.y + 1)//8) * 8 else Player.y = yCalc end

	--NotNeeded?
	--if(isRoofed(Player.x, Player.y) and yCalc < ((Player.y - 1)//8) * 8) then Player.y = ((Player.y - 1)//8) * 8 else Player.y = yCalc end
	--if(leftBlocked(Player.x, Player.y) and Player.x < ((Player.x - 1)//8) * 8) then Player.x = ((Player.x - 1)//8) * 8 end
	--if(rightBlocked(Player.x, Player.y) and Player.x > ((Player.x + 1)//8 + 2) * 8) then Player.x = ((Player.x + 1)//8) * 8 end
end

function Player.move()	
	--Salto: x Pressionado AND Jogador está no chão e não tem blocos sólidos em cima dele
	if btnp(5) and isGrounded(Player.x,Player.y) and not isRoofed(Player.x, Player.y)then 
		Player.voy=Player.v_salto t=0.1 --end
	 --Movimento no eixo X
	elseif btn(2) and not leftBlocked(Player.x, Player.y) then --Direifta
		Player.x=Player.x-Player.vox  
	elseif btn(3) and not rightBlocked(Player.x, Player.y) then --Esquerda
		Player.x=Player.x+Player.vox end 
	--Se saltou e volta a tocar no chão -> Recomeça o tempo e voy=0
	if isGrounded(Player.x,Player.y) and t>0.2 then 
		t=0 Player.voy=0 end
	--Cálculo e atualização da posição de Y
	mathY()

end

function Player.interaction()
    if btnp(4) then
        if (Level.LevelNumber == 0 and Player.x >= Yoda.xPosMinInteragir  and Player.x <= Yoda.xPosMaxInteragir)  or Yoda.drew == 1 then
            Yoda.drew = 1  
		elseif(isDoorTile(mget(Player.x//8+1+(Level.LevelNumber%8)*30,Player.y//8 + Level.reflected*17)) and Player.x>=15 and Yoda.drew == 0) then
			Level.LevelNumber_Previous=Level.LevelNumber
            Level.LevelNumber=Level.LevelNumber+1
            Player.x=Level.origX
            Player.y=Level.origY
        elseif isMirrorTile(mget(Player.x//8+1+(Level.LevelNumber%8)*30,Player.y//8+1 + Level.reflected*17)) or isMirrorTile(mget(Player.x//8+1+(Level.LevelNumber%8)*30,Player.y//8 + Level.reflected*17))then
				if(Level.reflected==0) then 
					Level.reflected = 1
					for i= 1,6 do
						poke(0x3fc0 + (i*3), peek(0x3fc0 + (i*3)) + colorOffset[i][1]) --r
						poke(0x3fc0 + (i*3 + 1), peek(0x3fc0 + (i*3) + 1) + colorOffset[i][2])
						poke(0x3fc0 + (i*3 + 2), peek(0x3fc0 + (i*3) + 2) + colorOffset[i][3])
					end
				else 
					Level.reflected=0
					for i= 1,6 do
						poke(0x3fc0 + (i*3), peek(0x3fc0 + (i*3)) - colorOffset[i][1]) --r
						poke(0x3fc0 + (i*3 + 1), peek(0x3fc0 + (i*3) + 1) - colorOffset[i][2])
						poke(0x3fc0 + (i*3 + 2), peek(0x3fc0 + (i*3) + 2) - colorOffset[i][3])
					end 
				end
		elseif(isLeverTile(mget(Player.x//8 + (Level.LevelNumber%8)*30, Player.y//8 + 1 + (Level.LevelNumber//8) * 17)
			or isLeverTile(mget(Player.x//8 + 1 + (Level.LevelNumber%8)*30, Player.y//8 + 1 + (Level.LevelNumber//8) * 17)) 
			or isLeverTile(mget(Player.x//8 + 2 + (Level.LevelNumber%8)*30, Player.y//8 + 1 + (Level.LevelNumber//8) * 17)))) then
			Level.LevelNumber = Level.LevelNumber+1
		elseif(isDiamondTile(mget(Player.x//8 + (Level.LevelNumber%8)*30, Player.y//8 + 1 + (Level.LevelNumber//8) * 17))) then
            Level.LevelNumber=Level.LevelNumber+1
		end
	end
	if(Level.LevelNumber > 5 and Level.LevelNumber < 9) then Boss.enable=true else Boss.enable = false end

end

function Player.bounds()
	if (isDeathTile(mget(Player.x//8+Level.LevelNumber*30,Player.y//8+Level.reflected*17+1))) then
		--meter player fora do mapa
		Player.x=500
		Player.y=500
		Level.LevelNumber=0
		Level.reflected=1
		elseif(Boss.enable == true) then 
			if((checkBossDamage(BossClawL.x, BossClawL.y, Player.x, Player.y) and (BCLstate ~= 4))  or (checkBossDamage(BossClawR.x, BossClawR.y, Player.x, Player.y) and (BCLstate ~= 4))) then
				Player.x=500
				Player.y=500
				Level.LevelNumber=0
				Level.reflected=1
			end
		end
	if(Level.LevelNumber == 0 and Level.reflected==1) then
		if(btn(4)) then
			reset()
		end
	end
	
end

function BossClawL.update()
	BossClawL.enabled = true
	BossClawL.timer = BossClawL.timer + 1
	   if((BossClawL.stateHand == 0) and BCLenabled) then
		   BossClawL.stateHand = 1
		   BossClawL.objX = Player.x
		   BossClawL.objY = Player.y
		   BossClawL.vx = (BossClawL.objX - BossClawL.x)/30
		BossClawL.vy = (BossClawL.objY - BossClawL.y)/70
	   elseif (BossClawL.stateHand == 1 and BossClawL.objX <= BossClawL.x) then --dirigir para o player x
		   BossClawL.stateHand = 2
	   elseif (BossClawL.stateHand == 2 and BossClawL.objY <= BossClawL.y) then --dirigir para o player y
		   BossClawL.stateHand = 3
		   BossClawL.timer = 0
		   BossClawL.vy = 0
		   BossClawL.vx = 0 
	   elseif (BossClawL.stateHand == 3 and BossClawL.timer == 10) then --esperar
		BossClawL.stateHand = 4
		   BossClawL.objX = BossClawL.xref
		   BossClawL.objY = BossClawL.yref
		   BossClawL.vx = (BossClawL.objX - BossClawL.x)/10
		   BossClawL.vy = (BossClawL.objY - BossClawL.y)/10
	   elseif (BossClawL.stateHand == 4 and BossClawL.objX >= BossClawL.x and BossClawL.objY >= BossClawL.y) then --voltar
		   BossClawL.stateHand = 0
		   BCLenabled = false
	   end
		   BCLstate = BossClawL.stateHand
	   if(BossClawL.stateHand == 1) then
			BossClawL.x = BossClawL.x + BossClawL.vx
	   elseif(BossClawL.stateHand == 2) then
			BossClawL.y = BossClawL.y + BossClawL.vy
	   elseif(BossClawL.stateHand == 4) then
			BossClawL.y = BossClawL.y + BossClawL.vy
			   BossClawL.x = BossClawL.x + BossClawL.vx
	   end
	   BCLstate = BossClawL.stateHand
end

function BossClawR.update()
	BossClawR.enabled = true
	BossClawR.timer = BossClawR.timer + 1
	if((BossClawR.stateHand == 0) and BossClawR.enabled) then
		BossClawR.stateHand = 1
		BossClawR.objX = Player.x
		BossClawR.objY = Player.y
		BossClawR.vx = (BossClawR.objX - BossClawR.x)/30
	BossClawR.vy = (BossClawR.objY - BossClawR.y)/70
	elseif (BossClawR.stateHand == 1 and BossClawR.objX >= BossClawR.x) then --dirigir para o player x
		BossClawR.stateHand = 2
	elseif (BossClawR.stateHand == 2 and BossClawR.objY <= BossClawR.y) then --dirigir para o player y
		BossClawR.stateHand = 3
		BossClawR.timer = 0
		BossClawR.vy = 0
		BossClawR.vx = 0 
	elseif (BossClawR.stateHand == 3 and BossClawR.timer == 10) then --esperar
	BossClawR.stateHand = 4
		BossClawR.objX = BossClawR.xref
		BossClawR.objY = BossClawR.yref
		BossClawR.vx = (BossClawR.objX - BossClawR.x)/10
		BossClawR.vy = (BossClawR.objY - BossClawR.y)/10
	elseif (BossClawR.stateHand == 4 and BossClawR.objX <= BossClawR.x and BossClawR.objY >= BossClawR.y) then --voltar
		BossClawR.stateHand = 0
		BCRenabled = false
	end
	BCRstate = BossClawR.stateHand
	if(BossClawR.stateHand == 1) then
		BossClawR.x = BossClawR.x + BossClawR.vx
	elseif(BossClawR.stateHand == 2) then
		BossClawR.y = BossClawR.y + BossClawR.vy
	elseif(BossClawR.stateHand == 4) then
		BossClawR.y = BossClawR.y + BossClawR.vy
			BossClawR.x = BossClawR.x + BossClawR.vx
	end
end
   
function Boss:update()
	if Boss.enable then
		if (not BCLenabled) and (not BCRenabled) then
			if (Player.x <= 116) then
			BCLenabled = true
				BCRenabled = false 
			else
			BCRenabled = true
				BCLenabled = false
			end
		elseif BCLenabled then BossClawL.update()
		elseif BCRenabled then	BossClawR.update()
		end
	end
end

function BossClawL.draw()
	local n = 377
	if BCLstate == 0 or BCLstate == 1 then n = 453 end
	spr(n, BossClawL.x, BossClawL.y, 2, 1, 1, 0 , 4, 4)
end
   
function BossClawR.draw()
   local n = 377
   if BCRstate == 0 or BCRstate == 1 then n = 453 end
   spr(n, BossClawR.x, BossClawR.y, 2, 1, 0, 0 , 4, 4)
end

function Boss.draw()
	--spr(338, Boss.headX, Boss.headY, -1, 2, 0, 0, 2, 2)
	if Boss.enable then
		BossClawL.draw()
		BossClawR.draw()
	end
end

function Player.draw()
	i =(timerTotal%60//30*2)
	if(not isGrounded(Player.x,Player.y)) then
		if(btn(2)) then 
			Player.reflected = 1
		elseif(btn(3))then
			Player.reflected = 0
		end
		spr(Player.JUMP, Player.x, Player.y,2,1,Player.reflected,0,2,2)
		Player.spid=Player.JUMP 
	elseif(btn(3)) then
	 	spr(Player.WALK-i, Player.x, Player.y,2,1,0,0,2,2)
		Player.reflected=0
		Player.spid=Player.WALK-i
	elseif (btn(2)) then
		spr(Player.WALK-i, Player.x, Player.y,2,1,1,0,2,2)
		Player.reflected=1
		Player.spid=Player.WALK-i
	else
		Player.spid=Player.STAND
	end	
	spr(Player.spid, Player.x, Player.y,2,1,Player.reflected,0,2,2)
end

function Yoda.draw()
	--desenhar Yoda
	if Level.LevelNumber == 0 then
		spr(Yoda.id1,Yoda.x, Yoda.y,0,2,0,0,2,2) end
	--escrever texto Yoda
	if(Yoda.drew == 1) then
		spr(85,0,42,-1,3,0,0,2,2)
		spr(87,46,42,-1,3,0,0,2,2)
		spr(87,92,42,-1,3,0,0,2,2)
		spr(87,138,42,-1,3,0,0,2,2)
		spr(85,180,42,-1,3,1,0,2,2)
		if a < Yoda.msgSize + 1 then
			print(Yoda.msg[a],22,60)
			print(Yoda.msg[a+1],22,72)
			if(btnp(4) and (Yoda.flag == 0) ) then
				a=a+2 end
			Yoda.flag = 0
		else 
			a = 1
			Yoda.drew = 0
			Yoda.flag = 1
		end
	end
end

function checkBossDamage(xb, yb, xc, yc)
	if((xb <= xc) and (xc <= xb + 32)) or ((xb <= (xc + 16)) and ((xc + 16) <= (xb + 32) )) then
		if((yb <= yc) and (yc <= yb + 32)) or ((yb <= (yc +16))) and ((yc +16) <= (yb +32)) then
			return true
		end
	return false
	end
end

function musicByLevel()
	if not (Level.LevelNumber == Level.LevelNumber_Previous) then
		Level.LevelNumber_Previous = Level.LevelNumber
		if (Level.LevelNumber == 0 and Level.reflected == 0) then
			music(0,0,0,true,100)
		elseif Level.LevelNumber == 2 then
			music(1,0,0,true)
		elseif Level.LevelNumber == 3 then
			music(6,0,0,true)
		elseif Level.LevelNumber == 4 then
			music(3,0,0,true)
		elseif Level.LevelNumber == 5 then
			music(4,0,0,true)
		elseif Level.LevelNumber == 6 then
			music(5,0,0,true)
		elseif Level.LevelNumber == 7 then
			music(2,0,0,true)
		elseif Level.LevelNumber == 8 then
			music(7,0,0,true)
		else end return
	end
end

