function resetGame()
	--if ended
	if(Level.LevelNumber == 0 and Level.reflected==1) then
		print("Press z to start your journey again",22,10)
		if(btnp(4)) then
			reset()
		end
	end
end

Engine = {_init = {}, _update = {Boss.update, Player.move,Player.bounds, Player.interaction, musicByLevel }, _draw = {Yoda.draw, Boss.draw, Player.draw}, larr = false, rarr = false, uparr = false, dnarr = false, }

function Engine:init()
	if self._init == nil then
		return
	end
	for i=1,#self._init do
		self._init[i]()
	end
end

function Engine:update()
	if self._update == nil then return end
	
	for i=1,#self._update do
		self._update[i]() end
end

function Engine:draw()
	cls(13)
	map(Level.LevelNumber*30,  Level.reflected*17)
	if(Level.LevelNumber == 0 and Level.reflected==1) then
		print("Press z to start your journey again",22,10)
	end
	if(Level.LevelNumber == 0 and Level.reflected==0)then
		print("Action",100,16,0)
		print("Jump",56,16,0)
		print("Move",8,16,0)
	end
	if Engine._draw == nil then
		return
	end
	for i=1,#Engine._draw do
		Engine._draw[i]()
	end
end

function Engine:onCicleEnd()
	--debug()
	--Atualização de variáveis
	t=t+1
	timerTotal=timerTotal+1
end

function TIC()
	if(t == 0) then
		Engine:init()
	end	
	Engine:update()
	Engine.draw()
	Engine:onCicleEnd()
end

